    display: flex;
    flex-direct: row;
    background-color: grey;
    align-items: center;
    justify-content: center;
`



export default () => {
    return (
        <Wrapper>

            <Half>
                <div>form</div>
            </Half>
            <Half>
                <div>img</div>
            </Half>
        </Wrapper>
    )
}
